import { createRouter, createWebHashHistory } from "vue-router";

import MtMainView from "../views/MtMainView.vue";

import MtHomePage from "../pages/MtHomePage.vue";
import MtSchedulePage from "../pages/MtSchedulePage.vue";

export default new RouterLink({
  mode: "history",
  routes: [
    {
      path: "/main",
      redirect: "/",
      name: "Main",
      component: MtMainView,
      children: [
        {
          path: "/",
          name: "Home",
          component: MtHomePage,
        },
        {
          path: "/schedule",
          name: "Schedule",
          component: MtSchedulePage,
        },
      ],
    },
  ],
});

const router = createRouter({
  history: createWebHashHistory(),
  routes,
});
